INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 0.0, 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 1, 24, 24015, "2019/07/31 12:00:00", 10021, 110501, 4);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (4.0, 0.0, 1, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 2, 24, 24016, "2019/07/31 12:00:00", 10021, 110501, 4);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 0.0, 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 3, 24, 24017, "2019/07/31 12:00:00", 10021, 110501, 4);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (5.2, 0.0, 2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 4, 24, 24018, "2019/07/31 12:00:00", 10021, 110501, 1);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (4.2, 0.0, 6, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 5, 24, 24019, "2019/07/31 12:00:00", 10021, 110501, 5);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 0.0, 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 6, 24, 24020, "2019/07/31 12:00:00", 10021, 110501, 2);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (6.4, 0.0, 6, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 7, 24, 24021, "2019/07/31 12:00:00", 10021, 110501, 1);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 0.0, 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 8, 24, 24022, "2019/07/31 12:00:00", 10021, 110501, 2);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (10.08, 0.0, 3, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 9, 24, 24023, "2019/07/31 12:00:00", 10021, 110501, 6);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (5.0, 0.0, 2, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 10, 24, 24024, "2019/07/31 12:00:00", 10021, 110501, 1);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 0.0, 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "カオリ（サマー）", 0.0, "2030/12/17 14:59:59", 11, 24, 24025, "2019/07/31 12:00:00", 10021, 110501, 2);
